import React from 'react';

const requestForm = () => {
    return (
        <div>
            <form method='get'>
                <div className='Form'>
                    <input type='text' name='name' id='name' placeholder='Оставьте своё имя' required />
                </div>
                <div className='Form'>
                    <input type='email' name='name' id='name' placeholder="Оставьте свой номер телефона" required />
                </div>
                <div className='Form'>
                    <input type='submit' />
                </div>
            </form>
        </div>
    )
};

export default requestForm;
